import { Card, CardActions, TextField, Typography, Button } from '@mui/material';
import { makeStyles } from '@mui/styles';
import React from 'react';

import { Link } from "react-router-dom";

import { getAuth, createUserWithEmailAndPassword } from "firebase/auth";

const useStyles = makeStyles((theme) => ({
    mainDiv: {
        width: "100%",
        maxWidth: "400px",
        // height: "428px",
        // maxHeight: "428px",
        textAlign: "center",
    },
    loginPaper: {
        width: "100%",
        padding: "25px",
        textAlign: "center",
    },
    loginPaperTitle: {
        marginBottom: "25px"
    },
    textField: {
        margin: "10px 10px 10px 10px"
    },
    submitButton: {
        margin: "10px"
    }
}))

const AccountDetails = () => {
    const classes = useStyles();

    return (
        <div className={classes.mainDiv}>
            <Card elevation={5}>
                <Typography variant="h2">Setting Up Your Account</Typography>
                <TextField margin="normal" variant="outlined" label="Email" type="email" />
                <TextField margin="normal" variant="outlined" label="Password" type="password" />
                <TextField margin="normal" variant="outlined" label="Confirm Password" type="password" />
            </Card>
        </div>
    )
}

export default AccountDetails;
